// 引入React核心库
import React, {Component} from 'react';
import style from './index.css';
import profileURL from '../../images/female.jpg';

// 创建类式组件
export default class SummaryInfo extends Component{
  render (){
    return (
      <div>
        <img className='profile' src={profileURL} alt='头像'/>
        <div>
          <div className={style.alias}>Hello</div>
          <div className={style.introduction}>React</div>
        </div>
      </div>
    )
  }
}
